import React from 'react';
import './skills.css';
import clogo from "../../asset/clogo.png"
import { IoLogoJavascript } from "react-icons/io5";

const Skills = () => {
    return (
        <section id='skills'>
            <span className='skillTitle'> What I do</span>
            <div className='skillBarsleft'>
                <div className='left'>
                    <div className='left1'>
                    <img src={clogo} alt="clogo" className='clogo' />
                    <div className='skillBarText'>
                        <h2>C language</h2>
                        <p> this is a demo </p>
                    </div>
                    </div>
                    <div className='right'>
                        <IoLogoJavascript className="java" size={100} color='yellow'></IoLogoJavascript>
                    </div>
                </div>
            </div>

        </section>
    );
}

export default Skills
